export class PathDef {
  private id: string;
  private d: string;
  private cellDimensions: CellDimensions;

  constructor(id: string, d: string, cellDimensions: CellDimensions) {
    this.id = id;
    this.d = d;
    this.cellDimensions = cellDimensions;
  }

  public toPathDef() {
    let jigsawPieceDimensions: JigSawDimensions = this.cellDimensions as JigSawDimensions;
    let scaleWidth = jigsawPieceDimensions.getWidth() / BASE_JIGSAW_PIECE_LENGTH;
    let scaleHeight = jigsawPieceDimensions.getHeight() / BASE_JIGSAW_PIECE_LENGTH;

    // Doing this to force a render refresh
    let id = this.id + '_' + this.cellDimensions.toString();

    return <path id={id} d={this.d} transform={getPathTransform(scaleWidth, scaleHeight)} />;
  }
}
function getPathTransform(scaleWidth: number, scaleHeight: number): string {
  return 'scale(' + scaleWidth + ' ' + scaleHeight + ')';
}
